import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Tic Tac Toe App</h1>
        <div className="board">
           <div className="box">x</div>
           <div className="box"></div>
           <div className="box"></div>
           <div className="box"></div>
           <div className="box"></div>
           <div className="box"></div>
           <div className="box"></div>
           <div className="box"></div>
           <div className="box"></div>
           </div>
      </div>
    );
  }
}

export default App;
